INSERT INTO cities (name, countries_id, description) VALUES
	('Moscow', 1, ' Город стоит на Москве-реке в Центральной России, его население оценивается в 12,4 миллиона жителей в черте города, более 17 миллионов жителей в городской черте и более 20 миллионов жителей в столичном регионе.'),
	('Saint-Petersburg', 1, 'Город на Неве, самый лучший город'),
	('Stockholm', 6, ' столица и крупнейший город Швеции. Расположен на протоках, соединяющих озеро Меларен с Балтийским морем.'),
	('Rome', 2, ' столица и крупнейший город Италии (по населению агломерации уступает Милану и Неаполю).'),
	('Sharm el-sheikh', 7, 'город-курорт в Египте на южной оконечности Синайского полуострова на побережье Красного моря Египетской ривьеры.'),
	('Hurghada', 7, ' город на востоке Египта, расположен в Африканской части Египта. Расположен на западном побережье Красного моря, на 400 км юго-восточнее Каира.'),
	('Venice', 2, 'Венеция и одноимённой территориальной единицы, приравненной к провинции.'),
	('Antalia', 5, 'Анталия стала центром санджака – административной единицы Османской империи.'),
	('Pekin', 9, 'Пеки́н — столица и один из городов центрального подчинения Китайской Народной Республики. Пекин с трёх сторон окружён провинцией Хэбэй и граничит с Тяньцзинем на юго-востоке.'),
	('Ottawa', 8, 'Расположена в восточной части провинции Онтарио на берегу реки Оттавы, по которой проходит граница между провинциями Онтарио и Квебек.'),
	('Warsaw', 3, 'столица и крупнейший по населению и по территории город Польши. Город стал фактической столицей в 1596 году.');
